	function tid_cidFreq($new){
		$tid_cidFreq=array();
		foreach($new as $cid =>$tid_list){
			foreach($tid_list as $tid =>$freq){
				$tid_cidFreq[$tid][$cid]=$freq;
			}
			arsort($tid_cidFreq[$tid]);
		}
		//print_r($tid_cidFreq);
		return $tid_cidFreq;
	}
	function de_nid($new){
		$cid_tidFreq=array();
		foreach($new as $cid => $nid_list){
			$cid_tidFreq[$cid]=array();
			foreach($nid_list as $nid => $tid_list){
				foreach($tid_list as $tid => $freq){
					if(!array_key_exists($tid,$cid_tidFreq[$cid])){
						$cid_tidFreq[$cid][$tid]=$freq;
					}
					else{
						$cid_tidFreq[$cid][$tid]+=$freq;
					}
				}
			}
		}
		//print_r($cid_tidFreq);
		return $cid_tidFreq;
	}
	function get_cidFreq($cid_tidFreq){
		$cid_list=array();
		foreach($cid_tidFreq as $cid =>$tid_list){
			$temp=0;
			foreach($tid_list as $tid => $freq){
				$temp+=$freq;
			}
			$cid_list[$cid]=$temp;
		}
		//print_r($cid_list);
		return $cid_list;
	}
	function TFIDF($new)
	{
		$new=de_nid($new);
		$count=count($new);
		$cid_allFreq=get_cidFreq($new);
		$new=tid_cidFreq($new);
		$result=array();
		//print_r($new);
		foreach($new as $tid => $cid_list){
			$idf=log($count/count($cid_list));
			$tf=0;
			foreach($cid_list as $cid => $freq){
				$tf=$new[$tid][$cid]/$cid_allFreq[$cid];
				$tfidf=$tf*$idf;
				$result[$cid][$tid]=$tfidf;
			}
			arsort($result[$cid]);
		}
		foreach($result as $cid => $tid_list){
			foreach($tid_list as $tid => $freq){
				echo $cid.'=>';
				echo $tid.'=>';
				echo $result[$cid][$tid];
				echo '<br /r>';
				break;
			}
		}
		//print_r($result);
		return $result;
	}
